  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Mingo National
  Wildlife Refuge outlines Refuge accomplishments from September through December
  of 1956. The report begins by summarizing the weather conditions, water conditions,
  food and cover, and fire during this period. Wildlife- including migratory birds,
  upland game birds, big game animals, furbearers, predators, rodents, raptors, and
  fish- is also covered. The Refuge development section discusses physical developments
  and plantings. A progress report on field investigations and applied research is
  included. Resource management is outlined; topics include fur harvesting. The public
  relations section discusses Refuge visitors and fishing. N-R forms and photographs
  are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
